Handle duplicate value error in CRUD app (react-redux + express-mongoose)<p>Having <code>mongoose</code> schema where <code>carNumber</code> should be unique:</p>

<pre><code>var Schema = mongoose.Schema({
  createdAt: {
    type: Date,
    default: Date.now
  },
  carNumber: {
    type: String, index: {unique: true, dropDups: true},
  },
  carOwner: String
});
</code></pre>

<p>With <code>express</code> controller function data is saved into db:</p>

<pre><code>export const addCar = (req, res) =&gt; {
  const newCar = new Car(req.body);
   newCar.save((err, car) =&gt; {
    if (err) {
      return res.json({ 'success': false, 'message': 'Some Error' });
    }
     return res.json({ 'success': true, 'message': 'Car '+ car.carNumber +' added successfully', car });   
  }) 
}
</code></pre>

<p>but returns <code>Unhandled Rejection (TypeError): Cannot read property 'carNumber' of undefined</code> when trying to add duplicate value. To avoid error function is updated to validate <code>undefined</code> value:</p>

<pre><code>export const addCar = (req, res) =&gt; {
  const newCar = new Car(req.body);
   newCar.save((err, car) =&gt; {
     if (car.carNumber === undefined) {
           return res.json({ 'success': false, '': 'Some Error' });
      }
    else {
        return res.json({ 'success': true, 'message': 'Car '+ car.carNumber +' added successfully', car });   
       }  
  }) 
}
</code></pre>

<p>But getting <code>Unhandled Rejection (SyntaxError): Unexpected token P in JSON at position 0</code> at <code>response.json().then(error =&gt; { ... }</code> in front-end redux action:</p>

<pre><code>export const addNewCar = (car) =&gt; {
  console.log(car)
  return (dispatch) =&gt; {
    dispatch(addNewCarRequest(car));
    return fetch(apiUrl, {
      method: 'post',
      body: car,
    }).then(response =&gt; {
      if (response.ok) {
        response.json().then(data =&gt; {
          console.log(data.car);
          dispatch(addNewCarRequestSuccess(data.car, data.message))
        })
      }
      else {
        response.json().then(error =&gt; {
          dispatch(addNewCarRequestFailed(error))
        })
      }
    })
  }
}
</code></pre>

<p>Feeling totally lost there... May someone was fallen into same problem? </p>

