How to find the matched element using custom ranking algorithm<p>I need to calculate rank on each account. Rank depends on the account who requested the method.</p>

<pre><code>var account; // assumed to be one requesting the method
const allMatches = Account.find({
    $or: [
            { argA: account.argA },
            { argB: account.argB },
            { argC: account.argC }
        ],
        _id: {$ne: account._id}
    });  
const getRank = (item) =&gt; {
    let rank = 0;
    if (item.argB === account.argB) {
        rank += 3;
    }
    if (item.argA === account.argA) {
        rank += 2;
    }
    if (item.argC === account.argC) {
        rank += 1;
    }
    return rank;
};
const compare = (a,b) =&gt; {
    const rankA = getRank(a);
    const rankB = getRank(b);
    if (rankA === rankB) return 0;
    return rankA &gt; rankB ? 1: -1;
}
// use the compare method 
allMatches.sort(compare);
account.set({match : allMatches[0]['id']});
</code></pre>

<p>However, I cant use the sort method like this, as it expects an object or a string. 
I need some help to proceed in the correct direction.</p>

<p>For example - 
If there are 3 accounts in the system </p>

<pre><code>A1 - {argA: 'A', argB: 'B', argC: 'C'}
A2 - {argA: 'D', argB: 'B', argC: 'F'}
A3 - {argA: 'G', argB: 'H', argC: 'C'}
</code></pre>

<p>Now if A1 needs to find a match - </p>

<pre><code>Rank score with A2 is = 3 // argB is same
Rank score with A3 is = 1 // argC is same
</code></pre>

<p>Hence A1 will match with A2, and thats what I need.</p>

