MongoDB aggregate pipeline - which step removed the last document?<p>Assume a simple setup where the MongoDB aggregation pipeline consists of two basic steps:</p>

<ol>
<li>match the wanted documents ($match)</li>
<li>check permisssions to the documents ($redact)</li>
</ol>

<p>This can be done like </p>

<pre><code>db.thingies.aggregate(
   [
     { $match: { SOME_CONDITION } },
     { $redact: {
        $cond: {
           if: { SOME_PERMISSION_CHECK },
           then: "$$KEEP",
           else: "$$PRUNE"
         }
       }
     }
   ]
);
</code></pre>

<p>Now imagine that you execute this 2 stage pipeline and the result is empty. Is there any way to determine whether this was:</p>

<ul>
<li>a 404: NOT-FOUND (the $match result was emty?), or</li>
<li>a 403: FORBIDDEN (the $redact result was empty)</li>
</ul>

<p>In short, was the empty result reached in stage 1 or was it reached in stage 2?</p>

