.aggregate([
    {
        $match: { 
            'Vacancy._id': { $in: [1, 2, 3] },
        }
    },
    {
        $group: { 
            '_id': {
                'VacancyId': '$Vacancy._id',
                'Status': '$Status'
            },
            'Count': { $sum: 1 }
        }
    },
    {
        $sort: {
            '_id.VacancyId': 1,
            '_id.Status': 1
        }
    }
])
</code></pre>

